from typing import List, Optional


class Solution:
    def floodFill(self, board: List[List[str]], i: int, j: int) -> None:
        """
        找到一个可以填充的点，然后遍历四周的点进行判断和赋值。
        :param board: 矩阵
        :param i: x
        :param j: y
        :return: 无返回值
        """
        if not self._isValid(board, i, j):
            return

        # 记录当前点是否已经被标记过了
        isMarked = False
        for k in range(-1, 2):
            for l in range(-1, 2):
                if (k == 0 or l == 0) and (i + k!= j + l or board[i][j]!= "."):
                    continue
                if self._isValid(board, i+k, j+l):
                    if board[i+k][j+l] == ".":
                        self.floodFill(board, i+k, j+l)
                    elif board[i+k][j+l] == "#":
                        isMarked = True
                        break

        if not isMarked:
            board[i][j] = "d"

    @staticmethod
    def _isValid(board: List[List[str]], i: int, j: int) -> bool:
        """
        判断是否越界或者不在水中
        :param board: 矩阵
        :param i: x
        :param j: y
        :return: 是否有效
        """
        return 0 <= i < len(board) \
               and 0 <= j < len(board[0]) \
               and board[i][j] == "."

    def gameOfDrones(self, board: List[List[str]]) -> List[List[str]]:
        """
        先从最左边开始，再从最上面开始
        :param board: 矩阵
        :return: 输出结果
        """
        for i in range(len(board)):
            for j in range(len(board[0])):
                if board[i][j] == ".":
                    self.floodFill(board, i, j)
        return board

