class Solution(object):
    def convertBST(self, root):
        """
        :type root: TreeNode
        :rtype: TreeNode
        """

        if not root or not root.left:
            return root

        queue = collections.deque()
        queue.append((root, 0))
        while len(queue) > 0:
            node, level = queue.popleft()
            if node is None:
                continue

            if level == 0:
                node.val = 'A'
            elif level % 2 == 0:
                node.val = 'E'
            else:
                node.val = 'H'

            queue.extend([(node.right, level+1), (node.left, level+1)])

        return root

