# Definition for a Node.
class Node(object):
    def __init__(self, val=None):
        self.val = val
        self.left = None
        self.right = None


class Solution(object):
    def transformToExpected(self, grid):
        """
        :type grid: List[List[str]]
        :rtype: List[List[str]]
        """
        if not grid or len(grid) == 0:
            return []

        # Find all e's in the grid
        es = []
        for i in range(len(grid)):
            for j in range(len(grid[0])):
                if grid[i][j] == 'e':
                    es.append((i, j))

        # Build tree from e's
        root = Node('e')
        q = deque()
        q.extend(es)
        while q:
            x, y = q.popleft()
            node = Node('e')
            node.parent = root
            root.addChild(node)
            if x > 0 and grid[x - 1][y] == 'e':
                q.append((x - 1, y))
            if y > 0 and grid[x][y - 1] == 'e':
                q.append((x, y - 1))
            if x < len(grid) - 1 and grid[x + 1][y] == 'e':
                q.append((x + 1, y))
            if y < len(grid[0]) - 1 and grid[x][y + 1] == 'e':
                q.append((x, y + 1))

        # Traverse tree to find all b's
        visited = set([root])
        stack = [(root, True)]
        while stack:
            parent, isLeft = stack.pop()
            if parent.isVisited():
                continue
            parent.setVisited()
            if isLeft:
                parent.val = 'l'
            else:
                parent.val = 'r'
            if parent.getParent().val!= 'e':
                parent.getParent().addChild(parent)
            stack.append((parent, False))
            stack.append((parent, True))
            visited.update(parent.getChildren())

        # Fill in the rest of the grid with.'s
        for i in range(len(grid)):
            for j in range(len(grid[0])):
                if grid[i][j] == 'e':
                    grid[i][j] = 'e'
                elif grid[i][j] == 'l':
                    grid[i][j] = 'b'
                elif grid[i][j] == 'r':
                    grid[i][j] = 'a'
                else:
                    grid[i][j] = '.'

        return grid

