import collections


class Solution(object):
    def findWords(self, board, words):
        """
        :type board: List[List[str]]
        :type words: List[str]
        :rtype: List[List[str]]
        """

        # 1. build a dict to store all possible words in each row/column
        # 2. for each word, check if it can be found in any of the rows or columns
        # 3. return the result
        d = {}
        for i in range(len(board)):
            d[i] = set()

        for j in range(len(board[0])):
            d[j] = set()

        for w in words:
            for i in range(len(board)):
                if w in self._get_words(w, board[i]) and not w in d[i]:
                    d[i].add(w)

            for j in range(len(board[0])):
                if w in self._get_words(w, list(zip(*board)[j])) and not w in d[j]:
                    d[j].add(w)

        res = []
        for i in range(len(board)):
            res.append([])
            for j in range(len(board[0])):
                res[-1].append('')

        for i in range(len(board)):
            for j in range(len(board[0])):
                if len(d[i]) > 0:
                    res[i][j] = sorted(list(d[i]), key=lambda x: (x[0], -ord(x[1])))[0]
                elif len(d[j]) > 0:
                    res[i][j] = sorted(list(d[j]), key=lambda x: (-ord(x[0]), x[1]))[0]

        return res

    def _get_words(self, s, lst):
        """
        :type s: str
        :type lst: List[str]
        :rtype: Set[str]
        """
        res = set()
        for i in range(len(lst)):
            if s == lst[i]:
                res.add(s)
        return res
